import React from 'react';
import ThemeSection from './sections/ThemeSection';
import imgGameOfThrones from '../assets/gameOfThrones_background.jpg';
import imgLesVisiteurs from '../assets/lesVisiteurs_background.jpg';
import imgHarryPotter from '../assets/harryPotter_background.jpg';
import imgHungerGames from '../assets/hungerGames_background.jpg';
import imgMarvel from '../assets/marvel_background.jpg';
import imgBreakingBad from '../assets/breakingBad_background.jpg';

class App extends React.Component {
  constructor(props) {
    super(props)
  }

  render() {
    return (
      <section>
        <ThemeSection key="0" title="Game of Thrones" image={imgGameOfThrones}/>
        <ThemeSection key="1" title="Les visiteurs" image={imgLesVisiteurs}/>
        <ThemeSection key="2" title="Harry Potter" image={imgHarryPotter}/>
        <ThemeSection key="3" title="Hunger Games" image={imgHungerGames}/>
        <ThemeSection key="3" title="Hunger Games" image={imgMarvel}/>
        <ThemeSection key="3" title="Breaking Bad" image={imgBreakingBad}/>
      </section>
    )
  }
}

export default App;
